import React from "react";
import { FaTwitterSquare, FaFacebookSquare, FaInstagramSquare, FaGithubSquare } from 'react-icons/fa';

export default function SocialIcons() {
    return (
        <>
            <FaTwitterSquare />
            <FaFacebookSquare />
            <FaInstagramSquare />
            <FaGithubSquare />
        </>
    )
}
